	add("parabiosis", "{\"term\":\"parabiosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|para|biosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The (natural or surgical) union of parts of two organisms, especially in such a way as to cause them to share their vascular systems). Organisms so joined then are called parabionts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;Stem Cell Bioengineering\u0026quot; Ed. B. Parekkadan et al\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Parabiosis is the condition of more than one living organism joined ..., with ... circulatory fluids being exchanged among the parabionts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The fusion of two embryos to form conjoined twin\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;Stem Cell Bioengineering\u0026quot; Ed. B. Parekkadan et al\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Conjoined identical twins... could be thought of as parabionts\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A transient physiological state of suspension of obvious vital activities such as to enable an organism to escape the notice of its enemies or to conserve its energy. \u0026lt;ref\u0026gt;[http://www.merriam-webster.com/dictionary/parabiosis]\u0026lt;/ref\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A form of symbiosis, typically among ants, in which different species share common nest galleries but maintain distinct broods and do not practice mutualism other than incidentally.\u0026lt;ref\u0026gt;Gordh, G \u0026amp; Headrick, D. H. A Dictionary of Entomology. CABI 2001. ISBN: 978-0851992914\u0026lt;/ref\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An alien form of life within an organism, commonly invasive, such as a growing cancer\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Walter Moxon.\u0026lt;ref\u0026gt; Guy\u0027s Hospital Reports 3rd series Vol XVIII 1873 [https://archive.org/details/3reportsguy18guysuoft]\u0026lt;/ref\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"quot;…the fever sperm coming into ... the living frame ... is able to create a sort of other life or parabiosis within it ...\u0026quot\", \"priority\":11}]}, \"synonyms\":{}}");

	add("parablepsis", "{\"term\":\"parablepsis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παρά\u0027 (beside) and \u0027βλέπω\u0027 (to look at)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A circumstance in which a scribe miscopies text due to inadvertently looking to the side while copying, or accidentally skips over some of it\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paracelsus", "{\"term\":\"paracelsus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From a combination of Ancient greek (to 1453) \u0027παρά|lang\u003dgrc\u0027 () and \u0027{{w|Aulus Cornelius Celsus|Celsus}}\u0027...\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Swiss thinker of the 16th century known for his pioneering scientific work and his research into the occult and alchemy\", \"priority\":1}]}, \"synonyms\":{}}");

