	add("paradigm", "{\"term\":\"paradigm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Established 1475-85 from \u0027paradīgma\u0027 from Ancient greek (to 1453) \u0027παράδειγμα\u0027 (pattern)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An example serving as a model or pattern; a template\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0026quot;s:Estate of William F. Jenkins v. Paramount Pictures Estate of William F. Jenkins v. Paramount Pictures Corp.\u0026quot\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"According to the Fourth Circuit, “Coca-Cola” is “the \u0027\u0027paradigm\u0027\u0027 of a descriptive mark that has acquired secondary meaning”\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Nicholas Asher and Alex Lascarides, \u0027Logics of Conversation\u0027, Cambridge University Press, ISBN 0 521 65058 5, page 46\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"DRT is a \u0027\u0027paradigm\u0027\u0027 example of a dynamic semantic theory\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A set of all forms which contain a common element, especially the set of all inflectional forms of a word or a particular grammatical category\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027paradigm\u0027\u0027 of \u0026quot;go\u0026quot; is \u0026quot;go, went, gone.\u0026quot\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A system of assumptions, concepts, values, and practices that constitutes a way of viewing reality\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A conceptual framework—an established thought process\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A way of thinking which can occasionally lead to misleading predispositions; a prejudice. A route of mental efficiency which has presumably been verified by affirmative results/predictions\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A philosophy consisting of ‘top-bottom’ ideas (namely biases which could possibly make the practitioner susceptible to the ‘confirmation bias’\", \"priority\":11}]}, \"synonyms\":{}}");

	add("paradigmata", "{\"term\":\"paradigmata\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027: F. Warren Rempel, \u0027The Role of Value in Karl Mannheim’s Sociology of Knowledge\u0027, [http://books.google.co.uk/books?id\u003d-Wk1AAAAIAAJ\u0026amp;q\u003d%22these+paradigmata%22\u0026amp;dq\u003d%22these+paradigmata%22\u0026amp;ei\u003d8gG6SI-OF43kywSBuNXGBw\u0026amp;pgis\u003d1 page 88] (Mouton\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"These \u0027\u0027paradigmata\u0027\u0027, these basic visions of life’s meaning, become the foundations for developing levels of value consciousness, as well as the concrete integrating principle of a world-view\", \"priority\":2}]}, \"synonyms\":{}}");

	add("paradise", "{\"term\":\"paradise\", \"etymology\":{\"influencers\":[], \"languages\":[\"Avestan\", \"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French paradis, from Latin paradisus, from Ancient greek (to 1453) παράδεισος ‘royal park, orchard’, from Avestan \u0027𐬞𐬀𐬌𐬭𐬌𐬸𐬛𐬀𐬉𐬰𐬀\u0027 from \u0027sc\u003davst|tr\u003dpairi|𐬞𐬀𐬌𐬭𐬌\u0027 (around) and \u0027sc\u003davst|tr\u003ddaēza|𐬛𐬀𐬉𐬰𐬀\u0027 (wall)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Heaven\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Garden of Eden\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A town in Californi\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A town in Grenad\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A city in Kansa\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A CDP in Montan\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A town in Newfoundland and Labrado\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A rural locality in New Zealan\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A community in Nova Scoti\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A CDP in Pennsylvani\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A village in Surinam\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A city in Texa\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A town in Uta\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A settlement on the island of Saint Croix in the United States Virgin Islands\", \"priority\":14}]}, \"synonyms\":{}}");

	add("parados", "{\"term\":\"parados\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027parados\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An embankment built to protect the rear of a position from enemy attack\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, \u0027The Middle Parts of Fortune\u0027, Vintage 2014, p. 309\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He stood up on the step; and then they both swerved, ducking quickly as something ripped up the air between them, flicked a stone from the \u0027\u0027parados\u0027, and sang, like the vibration of a tense wire, into the air behind them\", \"priority\":3}]}, \"synonyms\":{}}");

