	add("parklet", "{\"term\":\"parklet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|park|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A parking space sized area used for recreational or beautification purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Lisa P. White, Contra Costa Times, \u0027Martinez council to review outdoor dining proposal next month\u0027, [http://www.mercurynews.com/breaking-news/ci_20470362/martinez-council-review-outdoor-dining-proposal-next-month link\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Bison system has been used for \u0027\u0027parklets\u0027\u0027 in San Francisco and New York City\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parkour", "{\"term\":\"parkour\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027parkour\u0027 altered spelling of \u0027parcours\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An athletic discipline, in which practitioners traverse any environment in the most efficient way possible using their physical abilities, and which commonly involves running, jumping, vaulting, rolling, and other similar physical movements\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parlance", "{\"term\":\"parlance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027parlance\u0027 \u0027\u0027 from \u0027parler\u0027 () + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A certain way of speaking, of using words, especially when it comes to those with a particular job or interest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Speech, discussion or debate\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parley", "{\"term\":\"parley\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027parler\u0027 (to talk; to speak) from {{m|la|*paraulare||to speak}}, from \u0027parabolare\u0027 from Latin \u0027parabola\u0027 (comparison) from Ancient greek (to 1453) \u0027παραβολή\u0027 from \u0027παρά|sc\u003dpolytonic\u0027 (beside) with \u0027βολή|sc\u003dpolytonic\u0027 (throwing)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A conference, especially one between enemies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We yield on \u0027\u0027parley\u0027\u0027, but are stormed in vain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:Peter B. Peter B. Kyne, \u0027The Understanding Heart\u0027, Chapter I\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Without further \u0027\u0027parley\u0027\u0027 Garland rode off up the hog\u0027s-back and the sheriff rode off down it …\", \"priority\":4}]}, \"synonyms\":{}}");

	add("parlor", "{\"term\":\"parlor\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"French\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027parlur\u0027 and Old french (842-ca. 1400) \u0027parleor\u0027 from the verb \u0027parler\u0027 (to speak) \u0026lt;!-- or Old english (ca. 450-1100) \u0027parlour, parlur\u0027, French \u0027parloir\u0027, \u0027parlatorium\u0027. ? --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The living room of a house, or a room for entertaining guests; a room for talking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dSo, after a spell, he decided to make the best of it and shoved us into the front \u0027\u0027parlor\u0027\u0027. \u0027Twas a dismal sort of place, with hair wreaths, and wax fruit, and tin lambrekins, and land knows what all\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The apartment in a monastery or nunnery where the residents are permitted to meet and converse with each other or with visitors from the outside\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A room for lounging; a sitting-room; a drawing room\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A comfortable room in a public house\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A covered open-air patio\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A shop or other business selling goods specified by context\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A shed used for milking cattle\", \"priority\":8}]}, \"synonyms\":{}}");

	add("parma", "{\"term\":\"parma\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\", \"Latin\"], \"text\":\"From Italian {{m|it|Parma}}, from Latin {{m|la|Parma}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Province of Emilia-Romagna, Italy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A city, the capital of Parma\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parnassianism", "{\"term\":\"parnassianism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Parnassian|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A French literary style which began during the positivist period of the 19th century\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parnellite", "{\"term\":\"parnellite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Parnell|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the adherents of (1846-1891) in his advocacy of home rule for Ireland\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parody", "{\"term\":\"parody\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027lang\u003dla\u0027 from Ancient greek (to 1453) \u0027lang\u003dgrc|παρῳδία\u0027 () from \u0027lang\u003dgrc|παρά\u0027 () + \u0027ᾠδή\u0027 (song)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A work or performance that imitates another work or performance with ridicule or irony\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The lively \u0027\u0027parody\u0027\u0027 which he wrote was received with great applause\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A popular maxim, adage, or proverb\", \"priority\":4}]}, \"synonyms\":{}}");

	add("paronomasia", "{\"term\":\"paronomasia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027paronomasia\u0027 from Ancient greek (to 1453) \u0027παρονομασία\u0027 (play upon words which sound alike) from \u0027παρα-\u0027 () + \u0027ὀνομασία\u0027 (naming)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A pun or play on word\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Anthony Burgess, \u0027Enderby\u0027s Dark Lady\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"he gloomily regarded his new digital watch, faintly fascinated by the onward march of the square figures which turned one into the other with insolent ease, a kind of numerical \u0027\u0027paronomasia\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Thomas Pynchon, \u0027Mason \u0026amp; Dixon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Ev’rywhere but at Norfolk, where talk of Passion far outweighs its Enactment,– indeed, the Sailors’ \u0027\u0027Paronomasia\u0027\u0027 for that wretched Place, is ‘No-Fuck’\", \"priority\":5}]}, \"synonyms\":{}}");

	add("parovarium", "{\"term\":\"parovarium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|para|ovarium|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of tubules, a remnant of the Wolffian body, often found near the ovary or oviduct\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paroxetine", "{\"term\":\"paroxetine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an antidepressant drug, Paxil\", \"priority\":1}]}, \"synonyms\":{}}");

	add("paroxysm", "{\"term\":\"paroxysm\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027lang\u003dfr\u0027 from \u0027lang\u003dla\u0027 from Ancient greek (to 1453) \u0027lang\u003dgrc|παροξυσμός\u0027 () from \u0027lang\u003dgrc|παροξύνειν\u0027 () from \u0027lang\u003dgrc|παρά\u0027 () + \u0027lang\u003dgrc|ὀξύνειν\u0027 () from \u0027lang\u003dgrc|ὀξύς\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A random or sudden outburst (of activity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Unable to turn his back on the fanged danger and go on, the bull would be driven into \u0027\u0027paroxysms\u0027\u0027 of rage\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThe slightest effort made the patient cough. He would stand leaning on a stick and holding a hand to his side, and when the \u0027\u0027paroxysm\u0027\u0027 had passed it left him shaking\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"«There, on the soft sand, a few feet away from our elders, we would sprawl all morning, in a petrified \u0027\u0027paroxysm\u0027\u0027 of desire, and take advantage of every blessed quirk in space and time to touch each other\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, \u0027Mantissa\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Indeed in his excitement at this breakthrough he inadvertently dug his nails into the nurse\u0027s bottom, a gesture she misinterpreted, so that he had to suffer a \u0027\u0027paroxysm\u0027\u0027 of breasts and loins in response\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An explosive event during a volcanic eruption\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A sudden recurrence of a disease\", \"priority\":8}]}, \"synonyms\":{}}");

	add("paroxytonesis", "{\"term\":\"paroxytonesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being paroxytone\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parquet", "{\"term\":\"parquet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wooden floor made of parquetry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d“Piracy”: A Romantic Chronicle of These chapter\u003d1/1/3|url\u003dhttp://openlibrary.org/works/OL1519647W|passage\u003dThat large room had always awed Ivor: even as a child he had never wanted to play in it, for all that it was so limitless, the \u0027\u0027parquet\u0027\u0027 floor so vast and shiny and unencumbered, the windows so wide and light with the fairy expanse of Kensington Gardens\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d1|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dThe huge square box, \u0027\u0027parquet\u0027\u0027-floored and high-ceilinged, had been arranged to display a suite of bedroom furniture designed and made in the halcyon days of the last quarter of the nineteenth century,\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The part of a theatre between the orchestra and the parquet circle\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In some European countries, the branch of the administrative government that handles prosecutions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In some European bourses or stock exchanges, the railed-in space within which the \u0027agents de change\u0027, or privileged brokers, conduct business; also, the business conducted by them, distinguished from the coulisse, or outside market\", \"priority\":6}]}, \"synonyms\":{}}");

	add("parranda", "{\"term\":\"parranda\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\"], \"text\":\"Borrowed from Spanish \u0027parranda\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Venezuelan genre of music with African influences and drumming\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parricide", "{\"term\":\"parricide\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027parricide\u0027 from Latin \u0027parricida\u0027 of uncertain origin. Equivalent to {{suffix||cide|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who kills a relative, especially a parent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1605\u0027\u0027, William Shakespeare, \u0027King Lear\u0027 II.i\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I told him the reuenging Gods, / ’Gainst \u0027\u0027Paricides\u0027\u0027 did all the thunder bend\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Someone who commits treason\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The killing of a relative, especially a parent\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The killing of a ruler, or other authority figure; treason.Category:en:Death\", \"priority\":6}]}, \"synonyms\":{}}");

	add("parrotbill", "{\"term\":\"parrotbill\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|parrot|bill|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of warbler-like birds of uncertain taxonomy, native to East East and Southeast Asia, generally small and long-tailed, which inhabit reed beds and similar habitats and feed mainly on seeds\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parrothouse", "{\"term\":\"parrothouse\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|parrot|house|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An aviary where parrots and similar exotic birds are kept for display\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1964\u0027\u0027 — w:G. K. G. K. Chesterton, \u0027s:The Spice of Life and Other The Spice of Life and Other Essays\u0027, \u0027The Soul in Every Legend\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I do not deny that the poet may write an ode to a parrot as well as to a skylark; or for that matter a serenade to a penguin or a pelican. But he will prefer the parrot outside the \u0027\u0027parrothouse\u0027\u0027. He will prefer the pelican in the wilderness\", \"priority\":3}]}, \"synonyms\":{}}");

	add("parrotlet", "{\"term\":\"parrotlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parrot|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A miniature parrot of the New World of the genera \u0027Forpus\u0027, \u0027Nannopsittaca\u0027 and \u0027Touit\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parser", "{\"term\":\"parser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|parse|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who parses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A computer program that parses\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parsimoniousness", "{\"term\":\"parsimoniousness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being parsimonious\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parsley", "{\"term\":\"parsley\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027peresil\u0027 from Latin \u0027petroselinum\u0027 (spelt also \u0027petroselinon\u0027 lt;ref\u0026gt;[http://linguaeterna.com/vocabula/show.php?n\u003d33718 the entry] in :w:ru:Дворецкий И. Х.|Dvoretsky\u0027s and :w:ru:Корольков, Дмитрий Николаевич|Korol\u0027kov\u0027s \u0027Latin - Russian dictionary\u0027, the most voluminous Latin dictionary issued in the 20th century\u0026lt;/ref\u0026gt;), from Ancient greek (to 1453) \u0027πετροσέλινον\u0027 (parsley) from \u0027πέτρος\u0027 (rock, stone) + \u0027σέλινον\u0027 (celery)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bright green, biennial herb, \u0027Petroselinum crispum\u0027 or \u0027Petroselinum neapolitanum\u0027 having either flat or curled leaves\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The leaves of this plant used in Middle Eastern, European, and American cooking\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parson", "{\"term\":\"parson\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman from Old french (842-ca. 1400) \u0027persone\u0027 (lang\u003dfro) from \u0027persona\u0027 (lang\u003dla) from Latin \u0027persona\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Anglican cleric having full legal control of a parish under ecclesiastical law; a rector\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A Protestant minister\", \"priority\":2}]}, \"synonyms\":{}}");

	add("parts", "{\"term\":\"parts\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"intellectual ability or learnin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He was a man of great \u0027\u0027parts\u0027\u0027 but little virtue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"vicinity, regio\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027, Lord Cockburn, \u0027Memoir of Thomas Thomson\u0027, Scotland Bannatyne Club, page 241\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"We intend being at Leamington before long, unless some change in the weather should make our stay in these \u0027\u0027parts\u0027\u0027 more tolerable\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The male genitals\", \"priority\":6}]}, \"synonyms\":{}}");

	add("partage", "{\"term\":\"partage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027partage\u0027 from \u0027partir\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A part, portion or share\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Division, sharing; the act of portioning out or dividing up\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"looke into our Royall house, where so many \u0027\u0027partages\u0027\u0027 [tr. ], so many surnames, and so many severall titles have so encumbred us, that the originall of the stocke is utterly lost\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The one-time standard practice of the divvying up of artifacts between archaeologists, their patrons and the host territory\", \"priority\":4}]}, \"synonyms\":{}}");

	add("parthenocarpy", "{\"term\":\"parthenocarpy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"production of (seedless) fruit without fertilization of ovules\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parthenogenesis", "{\"term\":\"parthenogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"\u0027parthen-\u0027 (biologic and figurative senses: “absence of fertilisation”, “asexual reproduction”; theologic sense: “virgin”) (from Ancient greek (to 1453) \u0027παρθένος\u0027 (virgin) + \u0027-o-\u0027 {{suffix||genesis|gloss2\u003dmode of generation|lang\u003den}} (from Ancient greek (to 1453) \u0027γένεσις\u0027 (origin”, “creation”, “generation)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Reproduction by the development of a single gamete (\u0027viz.\u0027 an ovum or ovule) without fertilisation by a gamete of the opposite sex; compare\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 October 15, \u0026quot;Virgin Shark Gives Birth\u0026quot;, [http://abc.gov.au/news/stories/2008/10/15/2391404.htm?site\u003dnews AFP via Australian Broadcasting Corporation]: \u0026lt;!-- need article title, author, URL --\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Scientists say the birth is the second confirmed instance of a shark being conceived by \u0027\u0027parthenogenesis\u0027\u0027, a process in which an unfertilised egg develops into a new individual\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Asexual reproduction \u0027in toto\u0027; agamogenesis\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An instance or example of parthenogenesis\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"figurative uses of the biologic senses\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1870\u0027\u0027: w:James Russell James Russell Lowell, \u0027Among My Books\u0027, series I, \u0027Shakespeare Once More\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dbgSQvHJmyIwC\u0026amp;pg\u003dPA223\u0026amp;dq\u003d%22one+sin+involves+another,+and+forever+another,+by+a+fatal+parthenogenesis%22\u0026amp;ei\u003dPx21SvGwL5W-zATylbjsD\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22one%20sin%20involves%20another%2C%20and%20forever%20another%2C%20by%20a%20fatal%20parthenogenesis%22\u0026amp;f\u003dfalse page 223]\u0026lt;/span\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"We may learn, to be sure, plenty of lessons from Shakespeare. We are not likely to have kingdoms to divide, crowns foretold us by weird sisters, a father’s death to avenge, or to kill our wives from jealously ; but Lear may teach us to draw the line more clearly between a wise generosity and a loose-handed weakness of giving ; Macbeth, how one sin involves another, and forever another, by a fatal \u0027\u0027parthenogenesis\u0027\u0027, and that the key which unlocks forbidden doors to our will or passion leaves a stain on the hand, that may not be so dark as blood, but that will not out ; Hamlet, that all the noblest gifts of person, temperament, and mind slip like sand through the grasp of an infirm purpose ; Othello, that the perpetual silt of some one weakness, the eddies of a suspicious temper depositing their one impalpable layer after another, may build up a shoal on which an heroic life and an otherwise magnanimous nature may bilge and go to pieces\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Virgin birth, in reference to the Virgin Mary and Jesus Christ\", \"priority\":10}]}, \"synonyms\":{}}");

	add("parthenolatry", "{\"term\":\"parthenolatry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The worship of virgins, or of the Virgin Mary\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parthenon", "{\"term\":\"parthenon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027παρθενών\u0027 More information: see there.\u0026lt;!-- link, don\u0027t copy --\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An ancient temple to Athena and monument in the city of Athens. It is a symbol of Greek achievement in the arts and of Athenian democracy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parthood", "{\"term\":\"parthood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|part|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The relational quality of being a part\", \"priority\":1}]}, \"synonyms\":{}}");

	add("participant", "{\"term\":\"participant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027participant\u0027 from Latin \u0027participans\u0027 present participle of \u0027participare\u0027 see participate.Category:English words suffixed with -ant\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who participates\", \"priority\":1}]}, \"synonyms\":{}}");

	add("participation", "{\"term\":\"participation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle french (ca. 1400-1600) from Old french (842-ca. 1400) \u0027participacion\u0027 from \u0027participatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of participating, of taking part to a process\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the state of being related to a larger whol\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the process during which individuals, groups and organizations are consulted about or have the opportunity to become actively involved in a project or program of activity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An ownership interest or profit-sharing right\", \"priority\":4}]}, \"synonyms\":{}}");

	add("participle", "{\"term\":\"participle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) Old French|participle\u0027 (1388), ‘a noun-adjective’, variant of \u0027participe\u0027, from Latin \u0027participium\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of a verb that may function as an adjective or noun. English has two types of participles: the present participle and the past participle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("particle", "{\"term\":\"particle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027particule\u0027 and its source, Latin \u0027particula\u0027 (small part, particle) diminutive of \u0027pars\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very small piece of matter, a fragment; especially, the smallest possible part of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A part of speech which can not be inflected, an adverb, preposition, conjunction or interjectio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1844\u0027\u0027, E. A. Andrews: \u0027First Lessions in Latin; or Introduction to Andrews and Stoddard\u0027s Latin Grammar.\u0027 (6th edition, Boston), p.91 ([http://books.google.de/books?id\u003dw4MAAAAAYAAJ\u0026amp;pg\u003dPA91 at books.google\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"322. The parts of speech which are neither declined nor conjugated, are called by the general name of \u0027\u0027particles\u0027\u0027. 323. They are adverbs, prepositions, conjunctions, and interjections\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1894\u0027\u0027 (2008), B. L. Gildersleeve \u0026amp; G. Lodge: \u0027Gildersleeve\u0027s Latin Grammar\u0027 (reprint of the 3rd edition by Dover, 2008), p.9. ([https://books.google.de/books?id\u003dPfjBAgAAQBAJ\u0026amp;pg\u003dPA9 at books.google\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The Parts of Speech are the Noun (Substantive and Adjective), the Pronoun, the Verb, and the \u0027\u0027Particles\u0027\u0027 (Adverb, Preposition, and Conjunction\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A word that has a particular grammatical function but does not obviously belong to any particular part of speech, such as the word \u0027to\u0027 in English infinitives or O as the vocative particle\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In English there is no grammatical device to differentiate predicational judgments from nonpredicational descriptions. This distinction does cast a shadow on the grammatical sphere to some extent, but recognition of it must generally be made in semantic terms. It is maintained here that in Japanese, on the other hand, the distinction is grammatically realized through the use of the two \u0027\u0027particles\u0027\u0027 \u0026lt;u\u0026gt;wa\u0026lt;/u\u0026gt; and \u0026lt;u\u0026gt;ga\u0026lt;/u\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Traditional grammar typically recog-\u0026lt;br\u0026gt; nises a number of further categories: for example, in his \u0027Reference Book of\u0026lt;br\u0026gt; Terms in Traditional Grammar for Language Students\u0027, Simpson (1982) posits\u0026lt;br\u0026gt; two additional word-level categories which he refers to as \u0026lt;b\u0026gt;\u0027Particle\u0027\u0026lt;/b\u0026gt;, and\u0026lt;br\u0026gt; \u0027Conjunction\u0027. \u0026lt;b\u0026gt;Particles\u0026lt;/b\u0026gt; include the italicised words in (58) below:\u0026lt;br\u0026gt;(58) (a) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; He put his hat \u0027on\u0027\u0026lt;br\u0026gt;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;(b) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; If you pull too hard, the handle will come \u0027off\u0027\u0026lt;br\u0026gt;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;(c) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; He was leaning too far over the side, and fell \u0027out\u0027\u0026lt;br\u0026gt;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;(d) \u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp;\u0026amp;nbsp; He went \u0027up\u0027 to see the manage\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any of various physical objects making up the constituent parts of an atom; an elementary particle or subatomic particle\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0026amp; Jeff Forshaw, \u0027The Quantum Universe\u0027, Allen Lane 2011, p. 55\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"What, he asked himself, does quantum theory have to say about the familiar properties of \u0027\u0027particles\u0027\u0027 such as position\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"title\u003dA Palette of volume\u003d100|issue\u003d2|page\u003d146|magazine\u003d|url\u003dhttp://www.americanscientist.org/issues/feature/2012/2/a-palette-of-particles|passage\u003dThe physics of elementary \u0027\u0027particles\u0027\u0027 in the 20th century was distinguished by the observation of \u0027\u0027particles\u0027\u0027 whose existence had been predicted by theorists sometimes decades earlier\", \"priority\":13}]}, \"synonyms\":{}}");

	add("particularist", "{\"term\":\"particularist\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\"], \"text\":\"From {{suffix|particular|ist|lang\u003den}}, after French \u0027particulariste\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who holds to particularism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("parting", "{\"term\":\"parting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of parting or dividing; the state of being parted; division; separation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bible, Ezekiel xxi. 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027parting\u0027\u0027 of the way\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A farewell, the act of departing politely\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And there were sudden \u0027\u0027partings\u0027\u0027,such as press / The life from out young hearts\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, L. Frank Baum, \u0027The Wonderful Wizard of Oz\u0027 Chapter 2\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"But she hugged the soft, stuffed body of the Scarecrow in her arms instead of kissing his painted face, and found she was crying herself at this sorrowful \u0027\u0027parting\u0027\u0027 from her loving comrades\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The dividing line formed by combing the hair in different directions; part (\u0027US\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The surface of the sand of one section of a mould where it meets that of another section\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The separation and determination of alloys; especially, the separation, as by acids, of gold from silver in the assay button\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A joint or fissure, as in a coal seam\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The breaking, as of a cable, by violence\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Lamellar separation in a crystallized mineral, due to some other cause than cleavage, as to the presence of twinning lamellae\", \"priority\":13}]}, \"synonyms\":{}}");

	add("partitionist", "{\"term\":\"partitionist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|partition|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a political partisan who favours the partition of the province of Quebec with the western, southern portions and Montreal forming a separate province or country from the rest of Quebec\", \"priority\":1}]}, \"synonyms\":{}}");

	add("partiture", "{\"term\":\"partiture\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"Italian\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The printing of each instrument\u0027s part on a separate stave\", \"priority\":1}]}, \"synonyms\":{}}");

	add("partridge", "{\"term\":\"partridge\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Via Middle english (1100-1500) and Old french (842-ca. 1400) from Latin \u0027perdīx\u0027 (partridge) from Ancient greek (to 1453) \u0027πέρδιξ\u0027 (partridge)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any bird of a number of genera in the family \u0027Phasianidae\u0027, notably in the genera \u0027Perdix\u0027 and \u0027Alectoris\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A type cannon charge composed of several missiles fired all together, similar to langrage or case-shot. Also a large cannon that shoots stones\", \"priority\":2}]}, \"synonyms\":{}}");

	add("partwork", "{\"term\":\"partwork\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|part|work|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A written publication released as a series of pre-planned magazine-like issues over a period of time, distributed through the same channels as magazines\", \"priority\":1}]}, \"synonyms\":{}}");

